import Aside from "./Aside.js";
import Main from "./Main.js";

function Actions(props) {
  const list = {list1: "Don't cut tree", list2: "Don't cut tree", list3: "Don't cut tree"}
    return (
      <div className="Actions">
           <div className="container mb-5"> 
                <div className="col d-flex">
                  <div className="row"> 
                      <div className="col col-md-8 mx-auto d-flex">
                        <Main title={props.title} text={props.text} list={list} />
                      </div>

                      <div className="col col-md-4 d-flex align-items-center">
                        <Aside img={props.img}/>
                      </div>
                  </div>
                </div>
            </div>
      </div>
    );
  }
  
export default Actions;
